import Espacio from '../components/Admin/Espacio.jsx'
import Banner from '../components/Admin/Espacio.jsx'


class Admin extends React.Component{
    render (){
        return(
         <div>
             <div>
                 <NavBardentro/>
             </div>
             <div>
                 <Espacio/>
             </div>
             <div>
                 <Categorias/>
             </div>

             
             

         </div>
        
        ) 
    }
}
export default Admin ;
